INSERT INTO complexity_levels (id, complexity, description, service_category_id, created_at) VALUES
('d0db50b0-4a50-4fc7-a006-9c97530e38b2', 'LOW', 'Service user has some capacity and means to secure and/or maintain suitable accommodation but requires some support and guidance to do so.', '428ee70f-3001-4399-95a6-ad25eaaede16', '2021-05-26 22:04:34.070897+00'),
('110f2405-d944-4c15-836c-0c6684e2aa78', 'MEDIUM', 'Service user is at risk of homelessness/is homeless, or will be on release from prison. Service user has had some success in maintaining atenancy but may have additional needs e.g. Learning Difficulties and/or Learning Disabilities or other challenges currently.', '428ee70f-3001-4399-95a6-ad25eaaede16', '2021-05-26 22:04:34.070897+00'),
('c86be5ec-31fa-4dfa-8c0c-8fe13451b9f6', 'HIGH', 'Service user is homeless or in temporary/unstable accommodation, or will be on release from prison. Service user has poor accommodation history, complex needs and limited skills to secure or sustain a tenancy.', '428ee70f-3001-4399-95a6-ad25eaaede16', '2021-05-26 22:04:34.070897+00'),
('0d6a7e24-2c61-4ca7-ac09-ec6f754dc6e5', 'LOW', 'Service user has satisfactory basic numeracy & literacy skills. The Service user has previously been employed though there may be gaps with periods of inactivity due to redundancy/periods of imprisonment. There has been no critical development need to find a new job in their previous field of competence. The Service user values benefits of working but needs guidance to re-enter the workforce, change jobs or career path.', 'ca374ac3-84eb-4b91-bea7-9005398f426f', '2021-05-26 22:04:34.070897+00'),
('ab17dc4a-3f93-4ae5-a70d-2905b86b256c', 'MEDIUM', 'Service user has gaps in basic numeracy and literacy skills. The Service user has no or limited working experience. The Service user has partially completed vocational training but requires support with building confidence and motivation to develop training and/or employability skills, and also require support and coaching to develop or enhance skills to obtain and sustain employment.', 'ca374ac3-84eb-4b91-bea7-9005398f426f', '2021-05-26 22:04:34.070897+00'),
('439c6dab-0dd6-4eb9-8a4a-c69d3490e940', 'HIGH', 'Service user lacks basic literacy & numeracy skills and/or may have Learning Difficulties and/or Learning Disabilities. The Service user has no or limited working experience and/or have no qualifications or current qualifications and/or may have many barriers and restrictions to employment due to the nature of their offences (e.g. sex offender or violence). The Service user requires significant support and coaching to build motivation, confidence and basic skills to enter employment / training.', 'ca374ac3-84eb-4b91-bea7-9005398f426f', '2021-05-26 22:04:34.070897+00'),
('178ec337-0ec9-422c-b9da-ea969fdcf98a', 'LOW', 'Service user is not overly reliant on friends /family or others to supplement daily living expenses or regular outgoings. Service user''s circumstances may be currently leading to significant financial pressure but they are able to support themselves through legitimate means.', '96a63c39-4371-4f17-a6ec-265755f0cf7b', '2021-05-26 22:04:34.070897+00'),
('d771ae5e-01d4-43b0-a941-99b2c0c52d29', 'MEDIUM', 'Service user may commit crimes ''on the side'' to supplement legal income or may rely on others for what they consider to be necessities. Service user may be unable to pay debts because of other ''demands''.', '96a63c39-4371-4f17-a6ec-265755f0cf7b', '2021-05-26 22:04:34.070897+00'),
('65a682a7-9621-4dab-8040-08f3109321f8', 'HIGH', 'Service user income comes from the proceeds of crime, e.g. dealing drugs, robbery or stolen goods.  Service user relies on others for necessities and luxuries and servicing debts to illegitimate external sources. Service user may be unable to meet household and essential bills.', '96a63c39-4371-4f17-a6ec-265755f0cf7b', '2021-05-26 22:04:34.070897+00'),
('5392858e-3432-40cb-b277-4552e8ac4638', 'LOW', 'Service user who is highly motivated and have had sustained period of abstinence. Service user has successfully engaged in a period of treatment but requires support to sustain recovery.', '76bcdb97-1dea-41c1-a4f8-899d88e5d679', '2021-05-26 22:04:34.070897+00'),
('f6a063e4-7daa-4cf6-9042-22476f8b5ed9', 'MEDIUM', 'Service user who has had lapses/crises that may lead to relapse and/or is at a transition point, e.g. from prison into community. Service user has a moderate level of motivation but requires a high level of support.', '76bcdb97-1dea-41c1-a4f8-899d88e5d679', '2021-05-26 22:04:34.070897+00'),
('cf1fb9d3-5092-42dd-b8da-d9cedf96addc', 'HIGH', 'Service user who is sentenced to Community Sentence where there is a Dual Diagnosis and substance misuse treatment. Service user does not meet the threshold for secondary provision and/or are deemed unsuitable following assessment for treatment as part of a Community Sentence Treatment Requirement.  However, Service user has identifiable substance misuse, alcohol misuse, prescription, gambling or other dependencies linked to re-offending. Service user has a history of poor engagement with treatment services and requires a high level of motivation and support to engage with treatment.', '76bcdb97-1dea-41c1-a4f8-899d88e5d679', '2021-05-26 22:04:34.070897+00'),
('a8860894-2610-4070-aa66-72089417ceb2', 'LOW', 'Service user lacks confidence to engage in community activities and/or spend a significant amount of time alone.  Service user recognises the value of strong pro-social support groups but is struggling to develop these fully. Service user has got one or more close friends not involved in criminal activity and/or spends limited time each week with non-offending peers or some affiliation to non-offending groups and activities, but does not have a central role. Service user may recognise that some lifestyle choices and associations have affected their behaviour and may trigger re-offending, such as illegal drug use, alcohol, gambling, peer choice, limited medium and long-term goals.', 'b84f4eb7-4db0-477e-8c59-21027b3262c5', '2021-05-26 22:04:34.070897+00'),
('707a0244-6bfe-4f0a-80d9-5e79498e81a8', 'MEDIUM', 'Service user recognises the value of strong pro-social support groups but does not belong to any and shows limited interest in doing so. Service user spends the majority of their time alone or using social networking sites or web based sites but with limited face-to-face social interaction. Service user is aware of the value of positive attachments but does not have any at present and/or spends a significant amount of time with pro-criminal social groups. Service user engages in anti-social behaviours including (non-addiction) drug use, regular alcohol use, problematic gambling, poor behaviour that impact negatively on the wider community and/or displays impulsiveness in risk taking activities, e.g. putting themselves or others at risk of harm.', 'b84f4eb7-4db0-477e-8c59-21027b3262c5', '2021-05-26 22:04:34.070897+00'),
('005566a2-ca85-471c-9ac0-38f3aa749092', 'HIGH', 'Service user has limited or no attachments/associations that are unrelated to offending behaviour. Service user does not belong to community groups or pro-social organised activities and does not place value on being part of them. Service user has no strong relationships outside of immediate family with people who don''t offend and/or spends the majority of their time alone using social networking sites or web based sites but with no face-to-face social interaction. Service user has strong links to county lines, gang affiliations, exposure to extremism, at risk of radicalisation, certain online offences.', 'b84f4eb7-4db0-477e-8c59-21027b3262c5', '2021-05-26 22:04:34.070897+00'),
('ddc8ee4a-403e-47cc-9af1-815938429bbc', 'LOW', 'Service user has positive contact with some family or some significant others and may have positive support of family members. Service user has previously lost contact with family and recently renewed contacts but there remain some difficulties.', '9556a399-3529-4993-8030-41db2090555e', '2021-05-26 22:04:34.070897+00'),
('8e409327-e3ab-4c91-9300-2f61a409789f', 'MEDIUM', 'Service user describes more difficulties in relationships with family and significant others or is in the process of resolving difficulties. Service user has a mix of good and difficult relationships with family and significant others.', '9556a399-3529-4993-8030-41db2090555e', '2021-05-26 22:04:34.070897+00'),
('52ca5958-56c6-4ae3-99ca-86180265f717', 'HIGH', 'Service user has little or no contact with family and does not care about what family thinks feel or expects. Service user describes hostile, indifferent uncaring relationships with family and significant others. Service user''s relationship has recently ended or is likely to do so.', '9556a399-3529-4993-8030-41db2090555e', '2021-05-26 22:04:34.070897+00'),
('cb6f1c1c-29d4-4d34-902e-3c89ee8428a0', 'LOW', 'Service user has worries or issues and feels unable to cope but is not socially isolated and interacts with others. Service user has no known psychological issues or history of depression and mental health.', '8221a81c-08b2-4262-9c1a-0ab3c82cec8c', '2021-05-26 22:04:34.070897+00'),
('46c1ae33-f90b-4dfc-83f7-6eec49209084', 'MEDIUM', 'Service user has diagnosed documented psychological problems that are being managed well but requires support to maintain engagement. Service user has coping strategies but needs assistance. Service user shows signs of stress in meetings and requires support to effectively engage.', '8221a81c-08b2-4262-9c1a-0ab3c82cec8c', '2021-05-26 22:04:34.070897+00'),
('64a1b7ba-305e-4bcc-b427-01b575ace941', 'HIGH', 'Service user has suffered psychological and mental health problems over a period of time which is documented, and needs significant level of support to engage with service provision. Service user is socially isolated and struggles with numerous aspects of daily life.', '8221a81c-08b2-4262-9c1a-0ab3c82cec8c', '2021-05-26 22:04:34.070897+00'),
