('f1eebd5e-4a0f-457e-b1a8-62e8c7de1afd', 'HIGH', '[up to 12 sessions (including up to 3 pre-release face-to-face contacts)] Service user has high risk of reoffending. Service user has limited family support, a lack of social networks or minimal engagement with community services and there may be barriers to achieving community integration. Service user has additional vulnerabilities requiring support throughout release with a pattern of non-compliance and a high likelihood of non-compliance in early weeks of release, e.g. recalls or failure to attend appointments.', 'c036826e-f077-49a5-8b33-601dca7ad479', '2021-05-26 22:04:34.070897+00'),
